- input: "TEXT\x1CC00277541\x1CX0\x1C\x1CF3XA\x1CContinuing from June 2008, the Fairfax
    County Democratic Committee now pays two employees' salaries and benefits. One
    full time employee devotes more than 25 percent of his time to federal election
    activities, and 100 percent of his employment expenses (salaries, benefits, taxes
    and fees) are paid with federal funds. One part time employee devotes 100 percent
    of his time to non federal election activity and is paid wages and withholding
    taxes with non federal funds. Due to the accounting capacity of the employment
    service we use to pay wages and benefits, the employment service expenses of this
    employee are also charged to the federal account.  No other entities pay compensation
    for their employees to work for the committee either part time or full time. No
    additional payroll expenses are incurred outside of those presented above.  The
    committee maintains both Federal and non Federal accounts, and it has elected
    beginning in June 2008 to allocate its administrative expenses between accounts.
    \ All administrative overhead expenses are initially paid 100 percent with Federal
    funds, marked for later re-allocation, and the non federal share is recaptured
    retroactively pursuant to regulation. Beginning with June 2008 disbursements,
    \ the Committee is allocating joint federal / non federal administrative expenses
    on the 36 percent federal, 64 percent non federal split, exclusive of the payroll
    and benefits expenses discussed above. The first transfer of non federal funds
    into the federal account to cover joint administrative expenses will appear in
    the Sept 20 report covering the month of August 2008, for adminsitrative expenses
    incurred by the Committee in June and July 2008. In other words, the first actual
    transfer occurs in August for June and July permissible expenses. The Committee
    does not engage in any fundraising on behalf of candidates for Federal office,
    so all of its reported fund raising expenses are party fund raising.    This amendment
    is needed so that all 2008 reports conform with our new donor management software,
    provided by NGP, and implemented in March 2008. Conversion to this new software
    corrupted accumulated expenses by line number in the later 2008 FEC monthly reports,
    created errors in classification of disbursement data imported from Quickbooks
    accounting software, and caused duplicate reporting of some of our fund raising
    expenses. Duplicate transactions have been removed and reported only once. Corrections
    were made to other disbursements as needed.  Procedures have been put in place
    to avoid these errors in FEC reports filed in future months. "
